// SearchResults.js
import React from 'react';

function SearchResults({ results }) {
  return (
    <div className="search-results">
      {results.map((result) => (
        <div key={result.id}>
          <h2>{result.title}</h2>
          <p>{result.snippet}</p>
          <a href={result.link}>{result.link}</a>
        </div>
      ))}
    </div>
  );
}

export default SearchResults;
